import Link from "next/link";
import Header from "../components/header";
import react from "react";

function Index() {
  return (
    <main>
      <Header />
      <section>
        <Link href="/about">
          <a>Go to About Me</a>
        </Link>
      </section>
      <style jsx>{`
      body{
        font-size:5rem;
      }
      main{
        background-size:cover;
        background-position:center;
        height:100vh;
      }

      `}</style>
    </main>
  );
}

export default Index;
